1	Players Table & Homepage Update	This update has made it so that the filters on the Players Table remember your previous entries, until you press the 'Reset' button or navigate to a different page.  Additionally, the ability to sort the table by clicking on the headers has been implemented.  Please Note:  The sort feature is only available after you've filtered the table for the first time.  The prevents your web browser from sorting too much data and crashing.	Robin Andrea	2020-07-11 23:44:52.781117	2020-07-11 23:44:52.781117
2	Login Required for Database Access	Direct access to the database is no longer allowed.  You must be logged in to access the database.	Robin Andrea	2020-07-11 23:47:11.124437	2020-07-11 23:47:11.124437
3	Pagination to the Rescue	Pagination of the Players Database has been implemented, cutting down the load time significantly.  Only 35 records will be displayed at a time, before you can move to the next page.  Navigation links are located at the bottom of the list.	Robin Andrea	2020-07-14 00:45:24.090739	2020-07-14 00:45:24.090739
